import React, { Component } from 'react';
import 'bootstrap/dist/css/bootstrap.min.css';
import CartSummary from '../Main/CartSummary';
import { Link } from 'react-router-dom';
import { Nav, NavItem, NavLink, Navbar } from 'reactstrap';

export default class navi extends Component {
  render() {
    return (
      <div>
        <Nav className='navbar navbar-expand-lg navbar-light bg-light'>
        <Navbar color="light" light expand="md">
            <NavLink href="/">
              <Link to="/">Product Tracking System</Link>
            </NavLink>
            <NavLink>
              <Link to="form">Form Action</Link>
            </NavLink>
            <NavLink href="/form2">
              <Link to="form2">Form Action 2</Link>
            </NavLink>
          <CartSummary cart={this.props.cart.length} products={this.props.cart} RemovetoCart={this.props.RemovetoCart} />
        </Navbar>
        </Nav>
      </div>
    )
  }
}
